import React from 'react';
import WorkProfiles from "./Profiles"
// import './Profiles.js';

const App = () => {
   const styles = {
     display: "grid",

   }
  return (
    // component here
    <div>
    <WorkProfiles backgroundColor="moccasin" color="white"/>
    <WorkProfiles backgroundColor="green" color="white"/>
    <WorkProfiles backgroundColor="orange" color="white"/>
    <WorkProfiles backgroundColor="yellow" color="white"/>
    <WorkProfiles backgroundColor="red" color="white"/>
    <WorkProfiles backgroundColor="blue" color="white"/>
    <WorkProfiles backgroundColor="salmon" color="white"/>
    <WorkProfiles backgroundColor="maroon" color="white"/>
    <WorkProfiles backgroundColor="darkseagreen" color="white"/>
    <WorkProfiles backgroundColor="hotpink" color="white"/>
    </div>
  )
}

export default App;
